import React, {useState, useEffect} from "react";
// import {
//  UsersCard
// } from "./pages/Users";

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Typography from '@material-ui/core/Typography';
import { withStyles } from '@material-ui/core/styles';
 const Users = () =>{
  
  const [data, setData] = React.useState({
    error: '',
    data: [],
    temp: [],
    error: null,
    search: null,
    

  });
  const [q, setQ] = useState("");


  const CustomTableCell = withStyles(theme => ({
    body: {
      borderBottomColor: 'transparent',
      paddingTop: theme.spacing(1),
      paddingBottom: theme.spacing(1)
    }
  }))(TableCell);

  const getData = async () => {
    const url = 'https://api.foodealzapi.com/users';
    let user;
    user = [];
    await fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(res)
        setData({
          ...data,
          data: res,
          temp: res,

        });
      })
      .catch(error => {
        setData({
          ...data,
          error: 'Error Loading content',
        })
      })
  };

  const searchFilterFunction = (text) => {
    const newData = data.temp.filter((item) => {
      const itemData = `${item.nom.toUpperCase()}`;
      const textData = text.toUpperCase();
      return itemData.indexOf(textData) > -1;
    });
    setData({
      ...data,
      data: newData
    })
  };
 const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  justifyContent: 'center'
 }

 const Search1 = {
  
  backgroundColor: 'white',
   borderBottomWidth: 1,
    borderBottomColor: '#b4b4b4b4b4'
 }
 const item = { 
  fontSize: '12px',
  flexDirection: 'row',
  marginBottom: '10px',
   fontWeight: 'bold'
 }
return (
  <div>
      <div style={Title1}>
          <h2>Users</h2> 

      </div>
      <div style={Search1} >
      <input type="text" placeholder=" Search Here..." value={q} onChange={(e) => setQ(e.target.value)} />
      </div>
      <div >
      <Table>
            <TableHead>
              <TableRow>
                <CustomTableCell>userId</CustomTableCell>
                <CustomTableCell align="right">userFirstname</CustomTableCell>
                <CustomTableCell align="right">userLastname</CustomTableCell>
                <CustomTableCell align="right">userMail</CustomTableCell>
                <CustomTableCell align="right">userPhone</CustomTableCell>
                <CustomTableCell align="right">userBirthday</CustomTableCell>
                <CustomTableCell align="right">userPassword</CustomTableCell>
                <CustomTableCell align="right">userCity</CustomTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {/* {mockInvoice.map((item, index) => ( */}
                <TableRow >
                  {/* <CustomTableCell>
                    <Typography variant="body1" className="font-weight-bold">
                      {item.title}
                    </Typography>
                    <Typography variant="body1">{item.subtitle}</Typography>
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {formatPrice(item.price)}
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {item.quantity}
                  </CustomTableCell>
                  <CustomTableCell align="right">
                    {formatPrice(item.price * item.quantity)}
                  </CustomTableCell> */}
                </TableRow>
              {/* ))} */}
            </TableBody>
            </Table>
       
      </div>
      <div> 
        
      </div>
     
  </div>
)
 }
export default Users;
